import React from "react";
import Calendar from '../components/Calendar';
import ContactPage from '../components/ContactPage';
import NonBusiness from '../components/nonbusinessenquires';
import { useTranslation } from 'react-i18next';

function Contact() {
    const { t } = useTranslation();
    return (
        <div>
            {/* ContactPage at the top */}
            <ContactPage />

            {/* Calendar and NonBusiness side by side and centered */}
            <div style={styles.horizontalContainer}>
                <div style={styles.innerContainer}>
                    <Calendar />
                    <NonBusiness />
                </div>
            </div>
        </div>
    );
}

// Styles for the component
const styles = {
    horizontalContainer: {
        display: 'flex',
        justifyContent: 'center', // Center horizontally
        alignItems: 'center', // Center vertically
        minHeight: '50vh', // Ensure the container takes at least 50% of the viewport height
        padding: '20px',
        backgroundColor: '#f9f9f9', // Optional: Add a background color
    },
    innerContainer: {
        display: 'flex',
        justifyContent: 'space-between', // Space between Calendar and NonBusiness
        alignItems: 'flex-start', // Align items at the top
        gap: '20px', // Add spacing between the components
        maxWidth: '1200px', // Optional: Set a max width for the inner container
        width: '100%', // Ensure it takes full width
    },
};

export default Contact;
